import React,{useState} from "react";

export default function InputField(props)
{
    const [listOfInput,setInput] = useState([]);
    const fillInput = () =>{
        const loopInput = (item,index) =>{
            setInput(item);
        }
        props.forEach(fillInput);
    }
    return (
        <div>
            <h3>It works</h3>
        </div>
    );
}
